  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, physical, profile and laboratory
  analysis oceanographic data were collected aboard the Brooks McCall in the Gulf
  of Mexico from 2010-09-07 to 2010-09-11 in response to the Deepwater Horizon Oil
  Spill event on April 20, 2010, by the Subsurface Monitoring Unit (SMU), which consisted
  of multiple government and corporate agencies. These data include Semivolatile Organic
  Compounds, Total Petroleum Hydrocarbons (TPH) and Volatile Organic Compounds. The
  instruments used to collect these data included CTD and bottle along with other
  physical sampling devices. More specific information about each data set is located
  in their individual metadata records. The CTD data underwent preliminary quality
  assurance and control procedures at the National Coastal Data Development Center
  (NCDDC). The analytical chemistry data are provisional and provide results of onshore
  laboratory analysis of water and sediment samples. Cruise level information consisting
  of data management documents, cruise reports and plans, videos and pictures, and
  other miscellaneous documentation were gathered by the data managers. (NODC Accession
  0074853)\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
